import React from "react";
import queryString from "query-string";

function VolumeView({ volume }) {
  const { volumeInfo, averageRating, imageLinks } = volume;
  const { title, authors, publishedDate, description, pageCount } = volumeInfo;
  console.log("authors ", authors);
  console.log("image links ", imageLinks);
  return (
    <div>
      <h5>{title}</h5>
      <p>Published: {publishedDate}</p>
      <p>{pageCount}</p>
      <p>{averageRating}</p>
      <p>{description}</p>
    </div>
  );
}

export default class Volume extends React.Component {
  render() {
    const id = queryString.parse(this.props.location.search);
    console.log("the id from the string is ", id.id);
    return <div>This is the Volume Component</div>;
  }
}
